    "2016-05-26T07:07:06.665315",nt"name": "on-street-parking-supply",nt"isopen":
    true,nt"url": null,nt"notes": "Provides on-street parking supply per street
    segment for various policy, planning and operations purposes. Counts collected via
    field surveys from 2008-2014 assuming 17 feet per undemarcated parking space, with
    a few exceptions. Geoprocessing methodology involved a series of spatial joins between
    side of street points and each street segment. Full parking census methodology can
    be found at http://sfpark.org/resources/parking-census-data-context-and-map-april-2014/
    This dataset is updated infrequently on a schedule TBD. Other critical information:
    users should filter out segments with the value '5555' when aggregating parking
    census counts. This code is applied to some divided streets where the full parking
    census count for that street block was aggregated to one side of the divided street.",nt"license_title":
